import React from "react";
import "./Portfolio.css";
import { Link } from "react-router-dom";

export default function Portfolio() {
  return (
    <div className="portfolio">
      <div className="head">
        <h1>ABCD</h1>
        <h3>
          Login <Link to="/login"></Link>
        </h3>
      </div>
    </div>
  );
}
